INSERT INTO `base_achievement_type` VALUES (1780827338343714817, '000000', '🚩学术论文', '0', '0', 100, 1, '2024-04-18 13:14:58', 1, '2024-05-26 15:27:11', '学术论文是某一学术课题，在实验性、理论性或预测性上具有的新的科学研究成果或创新见解和知识的科学记录 ，或是某种已知原理应用于实际上取得新进展的科学总结，用以提供学术会议上宣读、交流、讨论或学术刊物上发表，或用作其他用途的书面文件。');
INSERT INTO `base_achievement_type` VALUES (1780828579203387393, '000000', '🚩科研项目', '0', '0', 100, 1, '2024-04-18 13:19:54', 1, '2024-05-27 10:01:30', '科研项目指国家各级政府支持的纵向科研项目（课题）、来自于企事业单位的横向科研合作开发项目（课题）和学院自筹科研项目（课题）。科研项目又可分为纵向科研项目和横向科研项目两种。纵向科研项目是指：科技部、国家自然科学基金委、国家社科规划办、教育部、省科技厅、省社科规划办、省教育厅、市科技局等政府科研主管部门批准立项的各类科学研究项目。横向科研项目是指由其他政府部门（含国家部委、省市部门）、企事业单位、公司、团体或个人委托我校教学科研单位或教师进行研究或协作研究的各类课题，包括国际间企业合作项目。');
INSERT INTO `base_achievement_type` VALUES (1780829767541985282, '000000', '🚩专著或编著', '0', '0', 100, 1, '2024-04-18 13:24:37', 1, '2024-05-27 10:01:34', '专著是指研究有一定的难度，学术上有新的突破，有较多独创的学术成果，对本学科的发展有较好的指导作用。编著是指在总结归纳他人研究成果的基础上，有自己的观点和见解，至少有1/3属作者自己的有新意的著述，对本学科的发展有较大的参考价值。');
INSERT INTO `base_achievement_type` VALUES (1780830750233858050, '000000', '🚩专利或软件著作权', '0', '0', 100, 1, '2024-04-18 13:28:32', 1, '2024-05-27 10:01:38', '专利是受法律规范保护的发明创造，是指一项发明创造向国家审批机关提出专利申请，经依法审查合格后向专利申请人授予的在规定的时间内对该项发明创造享有的专有权。计算机软件著作权是指自然人、法人或其他组织对计算机软件作品享有的财产权利和精神权利的总称，软件著作权主要是备案制。');
