INSERT INTO `sys_oper_log` VALUES (1794911779143741441, '000000', '成果类型', 2, 'top.sharehome.base.controller.AchievementController.edit()', 'PUT', 1, 'admin', '哈尔滨商业大学', '/achievement', '0:0:0:0:0:0:0:1', '', '{\"createDept\":null,\"createBy\":null,\"createTime\":\"2024-04-18 13:19:54\",\"updateBy\":null,\"updateTime\":\"2024-04-18 13:20:19\",\"achievementTypeId\":\"1780828579203387393\",\"achievementTypeName\":\"🚩科研项目\",\"status\":\"0\",\"remark\":\"科研项目指国家各级政府支持的纵向科研项目（课题）、来自于企事业单位的横向科研合作开发项目（课题）和学院自筹科研项目（课题）。科研项目又可分为纵向科研项目和横向科研项目两种。纵向科研项目是指：科技部、国家自然科学基金委、国家社科规划办、教育部、省科技厅、省社科规划办、省教育厅、市科技局等政府科研主管部门批准立项的各类科学研究项目。横向科研项目是指由其他政府部门（含国家部委、省市部门）、企事业单位、公司、团体或个人委托我校教学科研单位或教师进行研究或协作研究的各类课题，包括国际间企业合作项目。\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-05-27 10:01:31', 84);
INSERT INTO `sys_oper_log` VALUES (1794911794855604225, '000000', '成果类型', 2, 'top.sharehome.base.controller.AchievementController.edit()', 'PUT', 1, 'admin', '哈尔滨商业大学', '/achievement', '0:0:0:0:0:0:0:1', '', '{\"createDept\":null,\"createBy\":null,\"createTime\":\"2024-04-18 13:24:37\",\"updateBy\":null,\"updateTime\":\"2024-04-21 21:26:15\",\"achievementTypeId\":\"1780829767541985282\",\"achievementTypeName\":\"🚩专著或编著\",\"status\":\"0\",\"remark\":\"专著是指研究有一定的难度，学术上有新的突破，有较多独创的学术成果，对本学科的发展有较好的指导作用。编著是指在总结归纳他人研究成果的基础上，有自己的观点和见解，至少有1/3属作者自己的有新意的著述，对本学科的发展有较大的参考价值。\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-05-27 10:01:34', 29);
INSERT INTO `sys_oper_log` VALUES (1794911810072539138, '000000', '成果类型', 2, 'top.sharehome.base.controller.AchievementController.edit()', 'PUT', 1, 'admin', '哈尔滨商业大学', '/achievement', '0:0:0:0:0:0:0:1', '', '{\"createDept\":null,\"createBy\":null,\"createTime\":\"2024-04-18 13:28:32\",\"updateBy\":null,\"updateTime\":\"2024-04-18 13:29:54\",\"achievementTypeId\":\"1780830750233858050\",\"achievementTypeName\":\"🚩专利或软件著作权\",\"status\":\"0\",\"remark\":\"专利是受法律规范保护的发明创造，是指一项发明创造向国家审批机关提出专利申请，经依法审查合格后向专利申请人授予的在规定的时间内对该项发明创造享有的专有权。计算机软件著作权是指自然人、法人或其他组织对计算机软件作品享有的财产权利和精神权利的总称，软件著作权主要是备案制。\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-05-27 10:01:38', 26);
